window.bookSummaryJSON = "<p>As the last starfighter in Squadron 111, only Midshipman Henry Gallant can stop the invasion from an alien galactic empire. With the&nbsp;United Planets space fleet on the verge of annihilation, Gallant can expect no help. With so much uncertainty about the aliens, analyzing the captured equipment in his possession is critical.</p> <p>The fate of Earth could rest on the abilities of Midshipman Henry Gallant. Unfortunately, it is his abilities that are much in doubt. In an era of genetic engineering, he is the only \"natural\" left in the fleet. His shipmates have all expressed concern that he will not be up to the challenge.</p> <p>Only bright and attractive junior officer Kelsey Mitchel has shown any sympathy for him. Now, as his navigator on the last starfighter in Squadron 111, her life, as well as a good many others, depends on Henry Gallant.</p> <p><b>Follow the career of a young officer in the 22nd-century genetically engineered space navy. Perfect for fans of Honor Harrington and Horatio Hornblower.</b></p> <p>The four books in this audiobook collection include <i>Midshipman Henry Gallant in Space</i><a href=\"https://www.amazon.com/gp/product/B00ANXVPS0/ref=dbs_a_def_rwt_hsch_vapi_taft_p1_i6\">, </a><i>Lieutenant Henry Gallant</i>, <i>Henry Gallant and the Warrior</i>, and <i>Commander Henry Gallant</i>.</p>"; 
